'use client';
import { ListRoot } from './ListRoot.js';
import { ListItem } from './ListItem.js';
import { ListHeading } from './ListHeading.js';
import { Ordered, Unordered } from './Lists.js';

const List = {};
List.Root = ListRoot;
List.Item = ListItem;
List.Heading = ListHeading;
List.Ordered = Ordered;
List.Unordered = Unordered;
List.Root.displayName = 'List.Root';
List.Item.displayName = 'List.Item';
List.Heading.displayName = 'List.Heading';
List.Ordered.displayName = 'List.Ordered';
List.Unordered.displayName = 'List.Unordered';

export { List, ListHeading, ListItem, Ordered as ListOrdered, ListRoot, Unordered as ListUnordered };
